import React, { Component } from 'react';
import { BrowserRouter as Link } from 'react-router-dom';
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBNavLink, MDBContainer } from 'mdbreact';
import SignOutButton from '../SignOut';
import * as ROUTES from '../../../src/constants/routes';
import { AuthUserContext } from '../Session';

class Navigation extends Component {
    constructor(props) {
        super(props);
        this.state = {
            collapse: false,
            isWideEnough: false,
        };
        this.onClick = this.onClick.bind(this);
    }

    onClick() {
        this.setState({
            collapse: !this.state.collapse,
        });
    }

    render() {
        return (
            <div>
                <AuthUserContext.Consumer>
                    {authUser =>
                        authUser ? (
                            <Link>
                                <header>
                                    <MDBNavbar color="black" fixed="top" dark expand="md">
                                        <MDBContainer>
                                            <MDBNavbarBrand href="/">
                                                <strong>Navbar</strong>
                                            </MDBNavbarBrand>
                                            <MDBNavbarToggler onClick={this.onClick} />
                                            <MDBCollapse isOpen={this.state.collapse} navbar>
                                                <MDBNavbarNav left>
                                                    <MDBNavItem active>
                                                        <MDBNavLink to={ROUTES.LANDING}>Landing</MDBNavLink>
                                                    </MDBNavItem>
                                                    <MDBNavItem active>
                                                        <MDBNavLink to={ROUTES.HOME}>Home</MDBNavLink>
                                                    </MDBNavItem>
                                                    <MDBNavItem active>
                                                        <MDBNavLink to={ROUTES.ACCOUNT}>Account</MDBNavLink>
                                                    </MDBNavItem>
                                                    <MDBNavItem active>
                                                        <MDBNavLink to={ROUTES.ADMIN}>Admin</MDBNavLink>
                                                    </MDBNavItem>
                                                    <MDBNavItem active>
                                                        <MDBNavLink to="#"><SignOutButton /></MDBNavLink>
                                                    </MDBNavItem>
                                                </MDBNavbarNav>
                                            </MDBCollapse>
                                        </MDBContainer>
                                    </MDBNavbar>
                                    {/* <MDBView src="https://mdbootstrap.com/img/Photos/Others/img%20(51).jpg">
                                        <MDBMask overlay="black-strong" className="flex-center flex-column text-white text-center">
                                            <h2>This Navbar isn't fixed</h2>
                                            <h5>When you scroll down it will disappear</h5>
                                            <br />
                                            <p>Full page intro with background image will be always displayed in full screen mode, regardless of device </p>
                                        </MDBMask>
                                    </MDBView> */}
                                </header>
                            </Link>
                            // <main>
                            //     <MDBContainer className="text-center my-5">
                            //         <p align="justify">Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam,  quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis  aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla  pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia  deserunt mollit anim id est laborum.</p>
                            //     </MDBContainer>
                            // </main> 
                        ) : (
                                <Link>
                                    <header>
                                        <MDBNavbar color="black" fixed="top" dark expand="md">
                                            <MDBContainer>
                                                <MDBNavbarBrand href="/">
                                                    <strong>Navbar</strong>
                                                </MDBNavbarBrand>
                                                <MDBNavbarToggler onClick={this.onClick} />
                                                <MDBCollapse isOpen={this.state.collapse} navbar>
                                                    <MDBNavbarNav left>
                                                        <MDBNavItem active>
                                                            <MDBNavLink to={ROUTES.LANDING}>Landing</MDBNavLink>
                                                        </MDBNavItem>
                                                        <MDBNavItem active>
                                                            <MDBNavLink to={ROUTES.SIGN_IN}>Sign In</MDBNavLink>
                                                        </MDBNavItem>
                                                        {/* <MDBNavItem>
                                                            <MDBNavLink to="#"></MDBNavLink>
                                                        </MDBNavItem> */}
                                                    </MDBNavbarNav>
                                                </MDBCollapse>
                                            </MDBContainer>
                                        </MDBNavbar>
                                        {/* <MDBView src="https://mdbootstrap.com/img/Photos/Others/img%20(51).jpg">
                                            <MDBMask overlay="black-strong" className="flex-center flex-column text-white text-center">
                                                <h2>This Navbar isn't fixed</h2>
                                                <h5>When you scroll down it will disappear</h5>
                                                <br />
                                                <p>Full page intro with background image will be always displayed in full screen mode, regardless of device </p>
                                            </MDBMask>
                                        </MDBView> */}
                                    </header>
                                </Link>
                                // <main>
                                //     <MDBContainer className="text-center my-5">
                                //         <p align="justify">Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam,  quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis  aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla  pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia  deserunt mollit anim id est laborum.</p>
                                //     </MDBContainer>
                                // </main> 
                            )
                    }
                </AuthUserContext.Consumer>
            </div>

        );
    }
}

export default Navigation;

